import axios from "axios";
import React, { useState } from "react";
import Swal from "sweetalert2";

function Contact()
{
	const[name,setname] = useState('');
	const[email,setemail] = useState('');
	const[phone,setphone] = useState('');
	const[message,setmessage] = useState('');
	
   
		
	const contactrecord = () =>
	{
	if(name == "")
	{
		Swal.fire({
			title: "Validation Message",
			text: "Name Field iS Required*",
			icon: "wrong"
		  });
	}
	else if (email =="")
	{
		Swal.fire({
			title: "Validation Message",
			text: "Email Field iS Required*",
			icon: "wrong"
		  });
	}
	else if(phone == "")
	 {
		Swal.fire({
			title: "Validation Message",
			text: "Phone Field iS Required*",
			icon: "wrong"
		  });

	 }
	 else if(message =="")
	 {
		Swal.fire({
			title: "Validation Message",
			text: "Message Field iS Required*",
			icon: "wrong"
		  });
	 }
	 else
	 {
		axios.post('http://localhost:4000',{name,email,phone,message})
		Swal.fire({
			title: "Validation Message",
			text: "Feedback done",
			icon: "wrong"
		  });
	 }
	}
	return(
<div>
    



{/* <!--================================
=            Page Title            =
=================================--> */}

<section class="page-title bg-title overlay-dark">
	<div class="container">
		<div class="row">
			<div class="col-12 text-center">
				<div class="title">
					<h3>Contact Us</h3>
				</div>
				<ol class="breadcrumb p-0 m-0">
				  <li class="breadcrumb-item"><a href="index.html">Home</a></li>
				  <li class="breadcrumb-item active">Contact Us</li>
				</ol>
			</div>
		</div>
	</div>
</section>

{/* <!--====  End of Page Title  ====--> */}


<section class="section contact-form">
	<div class="container">
		<div class="row">
			<div class="col-12">
				<div class="section-title">
					<h3>Get in <span class="alternate">Touch</span></h3>
					<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Maiores, velit.</p>
				</div>
			</div>
		</div>
		
			<div class="col-md-6">
				<input type="text" class="form-control main" onChange={(e)=>setname(e.target.value)} value={name} name="name" id="name" placeholder="Name"/>
			</div>
			<div class="col-md-6">
				<input type="email" class="form-control main" name="email" onChange={(e)=>setemail(e.target.value)} value={email} id="email" placeholder="Email"/>
			</div>
			<div class="col-md-12">
				<input type="text" class="form-control main" name="phone" onChange={(e)=>setphone(e.target.value)} value={phone} id="phone" placeholder="Phone"/>
			</div>
			<div class="col-md-12">
				<textarea name="message" id="message" class="form-control main" onChange={(e)=>setmessage(e.target.value)} value={message} rows="10" placeholder="Your Message"></textarea>
			</div>
			<div class="col-12 text-center">
				<button onClick={contactrecord} type="submit" class="btn btn-main-md">Send Message</button>
			</div>
		
	</div>
</section>
</div>
    )
}

export default Contact
